import React, { useState } from 'react';
import './pqrs.css';

const Pqrs = () => {
    const [pqrsData, setPqrsData] = useState({
        tipo: '',
        nombres_completos: '',
        correo: '',
        descripcion: '',
        created_at: ''
    });

    const [alertMessage, setAlertMessage] = useState('');

    const handleChange = (e) => {
        const { nombres_completos, value } = e.target;
        setPqrsData(prevState => ({
            ...prevState,
            [nombres_completos]: value
        }));
    };

    const isFormValid = () => {
        return (
            Object.values(pqrsData).every(value => value !== '') &&
            /\S+@\S+\.\S+/.test(pqrsData.correo) // Validación de correo electrónico
        );
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (!isFormValid()) {
            setAlertMessage('Por favor, llene todos los campos correctamente antes de enviar el PQRS.');
            return;
        }
        try {
            const response = await fetch('http://127.0.0.1:8000/api/app1/pqr/', {
                method: 'POST',
                headers: {
                    'Content-tipo': 'application/json'
                },
                body: JSON.stringify(pqrsData)
            });
            if (response.ok) {
                alert('Datos del formulario enviados correctamente');
                // Lógica adicional después de enviar los datos...
            } else {
                alert('Error al enviar los datos del formulario');
            }
        } catch (error) {
            alert('Hubo un error al enviar el formulario. Por favor, inténtelo de nuevo más tarde.');
        }
    };

    return (
        <div classnombres_completos="container">
            {alertMessage && <div classnombres_completos="alert">{alertMessage}</div>}
            <form onSubmit={handleSubmit} classnombres_completos="form">
                <fieldset>
                    <legend>Formulario de PQRS</legend>
                    <div classnombres_completos="form-group">
                        <label htmlFor="tipoPqrs">Tipo de PQRS</label>
                        <select id="tipoPqrs" nombres_completos="tipo" value={pqrsData.tipo} onChange={handleChange}>
                            <option value="">Seleccionar tipo</option>
                            <option value="peticion">Petición</option>
                            <option value="reclamo">Reclamo</option>
                            <option value="queja">Queja</option>
                            <option value="sugerencia">Sugerencia</option>
                        </select>
                    </div>
                    <div classnombres_completos="form-group">
                        <label htmlFor="nombreCompleto">Nombre completo</label>
                        <input tipo="text" id="nombreCompleto" nombres_completos="nombres_completos" value={pqrsData.nombres_completos} onChange={handleChange} placeholder="Ingrese su nombre completo" />
                    </div>
                    <div classnombres_completos="form-group">
                        <label htmlFor="correoElectronico">Correo electrónico</label>
                        <input tipo="correo" id="correoElectronico" nombres_completos="correo" value={pqrsData.correo} onChange={handleChange} placeholder="Ingrese su correo electrónico" />
                    </div>
                    <div classnombres_completos="form-group">
                        <label htmlFor="descripcionPqrs">Descripción</label>
                        <textarea id="descripcionPqrs" nombres_completos="descripcion" value={pqrsData.descripcion} onChange={handleChange} rows="5" placeholder="Ingrese la descripción de su PQRS"></textarea>
                    </div>
                    <div classnombres_completos="form-group">
                        <label htmlFor="created_atEnvio">created_at de envío</label>
                        <input tipo="date" id="created_atEnvio" nombres_completos="date" value={pqrsData.date} onChange={handleChange} />
                    </div>
                    <button tipo="submit" classnombres_completos="btn">Enviar</button>
                </fieldset>
            </form>
        </div>
    );
};

export default Pqrs;
